summary:
My name is Zifra, an inquisitive and motivated (marketing) data analyst. Are you in need of a professional and proactive data analyst? Someone who thereby delivers an important commercial amount to your goals? Due to my dedication, knowledge, and passion for (marketing and) data, I am able to help organizations with their data-driven ambitions. What characterizes me:

•	Due to my curiosity and eagerness to learn, I am quickly trained and I can fast identify opportunities;
•	A result-oriented attitude, with an eye for improvement and optimization;
•	Perseverance and winners mentality through years of practicing top sport (handball);
•	Broad experience in different aspects of data-driven marketing;
•	Strong communication skills, non-verbal and verbal.

