•	Translating the information need into information provision in collaboration with data engineers and ICT colleagues;
•	Editing datasets based on ETL, which can be used in analyses;
•	Visualizing data using relevant software: Tableau and/or excel;
•	Performing an analysis based on relevant data;
•	Managing data-related content, such as authorization management and up-to-date information;
•	Monitoring data quality;
•	Coaching and professional guiding of the IM-Data team.', 'title': 'Business and data analyst HR data & reporting (a.i. via ElastIQ-Connect)', 'employment_type': 'Freelance'}]}, {'company': {'id': 11699, 'name': 'bol.com', 'logo': 'https://media.licdn.com/dms/image/C560BAQHxdrFFwmdbMQ/company-logo_400_400/0/1560243954004?e=1700697600&v=beta&t=b1HmVth91rEt_2g2TEtWbDAiSTff_kM30BlIZR1s16U', 'url': 'https://www.linkedin.com/company/bol-com/', 'employees': {'start': 1001, 'end': 5000}}, 'date': {'start': {'month': 4, 'day': None, 'year': 2020}, 'end': {'month': 7, 'day': None, 'year': 2022}}, 'profile_positions': [{'location': 'Utrecht', 'date': {'start': {'month': 4, 'day': None, 'year': 2020}, 'end': {'month': 7, 'day': None, 'year': 2022}}, 'company': 'bol.com', 'description': 'As a Marketing Data Analyst at Partner Marketing, I helped partners optimize their business on our platform to take maximum advantage of the platform. Based on the available data, we provided our partners with personalized information and inspiration so that they could do what they do best: run their business. I was responsible for:
•	Performing data analyzes to make the behavior of partners visible and to link it to contact moments;
•	Developing concrete communication flows and plans using Google BigQuery: devising and building campaign flows, determining and making target group selections, and automating target group selections;
•	Analyzing the results of communication moments with the aim to increase the effectiveness of the campaigns;
•	Developing and managing dashboards in Tableau, Google DataStudio, and Adobe Analytics;
•	Developing data-drive innovations that improve the relevance of current communication (in collaboration with our IT team);
•	Challenging and helping the team and an intern with other Marketing Data Analysts.', 'title': 'Marketing Data Analyst', 'employment_type': 'Full-time'}]}, {'company': {'id': None, 'name': 'Travel Agency Zifra', 'logo': None, 'url': None, 'employees': {'start': None, 'end': None}}, 'date': {'start': {'month': 9, 'day': None, 'year': 2019}, 'end': {'month': 1, 'day': None, 'year': 2020}}, 'profile_positions': [{'location': 'South-America', 'date': {'start': {'month': 9, 'day': None, 'year': 2019}, 'end': {'month': 1, 'day': None, 'year': 2020}}, 'company': 'Travel Agency Zifra', 'description': 'Backpacking for five months through South-America to admire the beautiful landscapes and different cultures.', 'title': 'Travel Manager', 'employment_type': 'Full-time'}]}, {'company': {'id': 9444808, 'name': 'Superprof', 'logo': 'https://media.licdn.com/dms/image/D4E0BAQHp-vkidc931g/company-logo_400_400/0/1664543701610?e=1700697600&v=beta&t=Q8209O0HZjz1eGBt4E_wznadC9lGbH0lUYGyfpIZbKE', 'url': 'https://www.linkedin.com/company/superprof/', 'employees': {'start': 51, 'end': 200}}, 'date': {'start': {'month': 1, 'day': None, 'year': 2019}, 'end': {'month': 7, 'day': None, 'year': 2019}}, 'profile_positions': [{'location': None, 'date': {'start': {'month': 1, 'day': None, 'year': 2019}, 'end': {'month': 7, 'day': None, 'year': 2019}}, 'company': 'Superprof', 'description': 'During my second master thesis I wanted to do something with a value. To give something back to the community. Therefore I started to help students with Mathematics, Marketing and Economics. I know how valuable it is to get the help you need to reach your goals.', 'title': 'Tutor marketing, statistics and math', 'employment_type': 'Part-time'}]}, {'company': {'id': 11699, 'name': 'bol.com', 'logo': 'https://media.licdn.com/dms/image/C560BAQHxdrFFwmdbMQ/company-logo_400_400/0/1560243954004?e=1700697600&v=beta&t=b1HmVth91rEt_2g2TEtWbDAiSTff_kM30BlIZR1s16U', 'url': 'https://www.linkedin.com/company/bol-com/', 'employees': {'start': 1001, 'end': 5000}}, 'date': {'start': {'month': 8, 'day': None, 'year': 2018}, 'end': {'month': 1, 'day': None, 'year': 2019}}, 'profile_positions': [{'location': 'Utrecht Area, Netherlands', 'date': {'start': {'month': 8, 'day': None, 'year': 2018}, 'end': {'month': 1, 'day': None, 'year': 2019}}, 'company': 'bol.com', 'description': 'Besides writing my thesis, I worked on several marketing communication and data projects. I helped develop new content for our partners. In addition, I analyzed the current content on the website using Google Analytics and provided suggestions for improvement.', 'title': 'Internship with thesis - M&C B2B', 'employment_type': 'Internship'}]}, {'company': {'id': 942457, 'name': 'WPS B.V.', 'logo': 'https://media.licdn.com/dms/image/C4E0BAQHvG7Elzhph7w/company-logo_400_400/0/1629203184218?e=1700697600&v=beta&t=6jCb8UArGthSaR3JF8NgnvkzABZtcO77hsSgI5zAQ78', 'url': 'https://www.linkedin.com/company/wps-horti-systems-bv/', 'employees': {'start': 51, 'end': 200}}, 'date': {'start': {'month': 12, 'day': None, 'year': 2016}, 'end': {'month': 7, 'day': None, 'year': 2018}}, 'profile_positions': [{'location': 'de Lier', 'date': {'start': {'month': 12, 'day': None, 'year': 2016}, 'end': {'month': 7, 'day': None, 'year': 2018}}, 'company': 'WPS | We Prove Solutions', 'description': 'During my masters I worked at WPS in the marketing and communication department. WPS provides technical solutions within the horticultural sector. Within WPS I was responsible for devising and creating content for the Dutch, German, and English markets. I developed newsletters and web pages. Moreover, I was responsible for national and international fairs.', 'title': 'Marketing- and Communication', 'employment_type': 'Part-time'}]}, {'company': {'id': None, 'name': 'Rabobank Westland', 'logo': None, 'url': None, 'employees': {'start': None, 'end': None}}, 'date': {'start': {'month': 2, 'day': None, 'year': 2016}, 'end': {'month': 9, 'day': None, 'year': 2016}}, 'profile_positions': [{'location': 'De Lier', 'date': {'start': {'month': 5, 'day': None, 'year': 2016}, 'end': {'month': 9, 'day': None, 'year': 2016}}, 'company': 'Rabobank Westland', 'description': 'Fulfilled various activities for the SME department of Rabobank Westland. Besides that I was a project member of the Business Retail Finance implementation. This project included generating and executing ideas for the implementation of Zakelijk Retail Financieren.', 'title': 'All-round Employee SME', 'employment_type': 'Full-time'}, {'location': 'de Lier', 'date': {'start': {'month': 2, 'day': None, 'year': 2016}, 'end': {'month': 6, 'day': None, 'year': 2016}}, 'company': 'Rabobank Westland', 'description': 'During a five-month graduation internship, I wrote my thesis on the online financing process. I researched internal processes and local banks and customer experiences.', 'title': 'Thesis at SME', 'employment_type': 'Full-time'}]}, {'company': {'id': 1292, 'name': 'The Walt Disney Company', 'logo': 'https://media.licdn.com/dms/image/C4E0BAQE7OIxItpOtzA/company-logo_400_400/0/1672755875327?e=1700697600&v=beta&t=31b2V64o8SGLCjMVg6ZGQj2eVnzlKNsabC5lym5soxk', 'url': 'https://www.linkedin.com/company/the-walt-disney-company/', 'employees': {'start': 10001, 'end': None}}, 'date': {'start': {'month': 8, 'day': None, 'year': 2014}, 'end': {'month': 1, 'day': None, 'year': 2015}}, 'profile_positions': [{'location': 'Hoofddorp', 'date': {'start': {'month': 8, 'day': None, 'year': 2014}, 'end': {'month': 1, 'day': None, 'year': 2015}}, 'company': 'The Walt Disney Company', 'description': 'A fulltime internship at Disney media+ within the Ad Sales department for 5 months. My responsibilities were creating a marketing plan, doing market research, and cooperating with daily affairs.', 'title': 'Internship Dinseymedia+ AdSales', 'employment_type': 'Internship'}]}]
